, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"645564","type":"CustomJS"},{"attributes":{"label":{"value":"Peak (256%)"},"renderers":[{"id":"645274"}]},"id":"645291","type":"LegendItem"},{"attributes":{},"id":"645528","type":"UndoTool"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"point_policy":"follow_mouse","renderers":[{"id":"645410"}],"tooltips":[["Date","@datetime{%c}"],["Size","@size{0,0}"],["P/L","@returns_short{+0.[000]%}"]]},"id":"645414","type":"HoverTool"},{"attributes":{"coordinates":null,"data_source":{"id":"645214"},"glyph":{"id":"645488"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"645490"},"nonselection_glyph":{"id":"645489"},"view":{"id":"645492"}},"id":"645491","type":"GlyphRenderer"},{"attributes":{"data":{"Close":{"__ndarray__":"MzMzMzP/dkBI4XoUrht7QM3MzMzMlHpAj8L1KFwHfUD2KFyPwmmAQBSuR+F69INA9ihcj8KXg0DhehSuR/uBQI/C9ShczYJA4XoUrkfLhUBSuB6F68mGQClcj8L1AIxAuB6F61GkjEBxPQrXo4OSQHE9CtejaI5AMzMzMzOilUDD9Shcj3GhQB+F61E4k6NAFK5H4fpHpUAfhetROPSwQOxRuB4FqqxA9ihcjwL8t0BI4XoUjlzCQD0K16OQE8tAAAAAAACIxkCF61G4/r7CQAAAAACAgsBAexSuR4FWwkBxPQrXo7K8QArXo3D9BbhAUrgehSsMwEAUrkfh+jW6QAAAAAAAzblAhetRuJ4DuUAAAAAAAMKuQAAAAAAA6q1A16NwPQqWq0A9CtejcCytQBSuR+H6/a9AAAAAAAAjtECPwvUo3A3BQHsUrkehBMVAAAAAAICewkCPwvUoXM3DQLgeheuRdb9AUrgehWumwkBxPQrXo/y6QNejcD1K2bxAAAAAAIDJwEB7FK5HgXbDQClcj8I19bZAZmZmZmYavkBcj8L1SHPCQIXrUbiezMFAAAAAAIBqw0B7FK5HAeLGQJqZmZkZDcVAAAAAAIB6yUD2KFyPgsbRQJqZmZmppNlA4XoUrjcu4EAAAAAA+BXmQNejcD1aPOtAAAAAACD850BI4XoUrmrhQMP1KFyn8uBAH4XrUYhM4UD2KFyPUtTnQD0K16NAFeVASOF6FPbz7UAK16NwpfzrQHsUrkc5zuhAMzMzM6uB4kD2KFyPomriQB+F61FA4OZAuB6F6xFF40CuR+F6xMHcQBSuR+H6iNRAj8L1KNzC1kC4HoXrgRjTQKRwPQonXtJAUrgehasl1EAfhetR+AjQQHsUrkdBb9BAMzMzM3Mw10DsUbgeNQHXQJqZmZk5VttAXI/C9ciP3ED2KFyPgmnbQMP1KFwPxN1AXI/C9ViY3EDXo3A9ynrZQMP1KFyPotlAw/UoXM/c4EB7FK5H2UriQLgehesBpuRAFK5H4VKG5EAAAAAAYELpQGZmZma
